CREATE TABLE migrate.Order_details (
	order_details_id int NOT NULL,
    code_ref              numeric(8) not null,
    code_cde              numeric(8),
    ean13_cde             numeric(13),
    quantity_uc           numeric(13, 3),
    quantity_uc_delivered numeric(4),
    parcel_id             integer    not null,
    date_mod              timestamp,
    date_cre              timestamp,
	article_name		  varchar(50),
	category		  	  varchar(50),
	PRIMARY KEY (order_details_id)
);

ALTER TABLE ONLY migrate.Order_details
ADD total_price integer;

UPDATE migrate.order_details
SET total_price = 1000
where order_details_id >= 10;

UPDATE migrate.order_details
SET total_price = 1500
where order_details_id >= 200;

UPDATE migrate.order_details
SET total_price = 9999
where order_details_id >= 400;

